import React from 'react';
import './css/resourcesPage.css'; // Ensure this is the correct path to your CSS file

// Example resource card component
const ResourceCard = ({ name, color }) => {
  return (
    <div className="resource-card" style={{ backgroundColor: color }}>
      <span className="resource-name">{name}</span>
    </div>
  );
};

function ResourcesPage() {
  const resources = [
    { name: 'Budgeting', color: 'red' },
    { name: 'Living Expense', color: 'blue' },
    { name: 'Education', color: 'green' },
    { name: 'Food', color: 'yellow' },
    { name: 'Parks', color: 'teal' },
    { name: 'Shopping', color: 'lightblue' },
    { name: 'Daycare', color: 'orange' },
    { name: 'Healthcare', color: 'purple' },
    { name: 'College Fund', color: 'violet' },
    { name: 'Etc', color: 'grey' },
  ];

  return (
    <div className="resources-container">
      <h2>Resources</h2>
      <div className="resources-grid">
        {resources.map((resource, index) => (
          <ResourceCard key={index} name={resource.name} color={resource.color} />
        ))}
      </div>
    </div>
  );
}

export default ResourcesPage;
